import React from "react";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import "./App.css";

class App extends React.Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route path="/login">
            <Login></Login>
          </Route>
          <Route path="/register"><Register></Register></Route>
          <Route path="/password-reset"><PasswordReset></PasswordReset></Route>
          <Route path="/"></Route>
        </Switch>

      </Router>
    );
  }
}

export default App;
